import React, {Component} from 'react';
import axios from 'axios';

class Konto extends Component {
    constructor(props){
        super(props);
        this.state = {
            data : null,
        };
    }
dateClick(){
    axios({
        method: 'post',
        url: 'http://localhost:8081/history/add',
        data: {
            idPrac: 1,
            rod : "magazyn ",
            idRod :2,
            typ :"update",
            dat:"2021-06-21T22:00"
        }
    });

    axios.post('http://localhost:8081/tow/add', {  nTow:"TOWAR1111",wyTow:"10X20X7", wTow:0.4, pTow:"China",kTow:"489598595265295" }
    ).then(response => {
        console.log(response)
    })
        .catch(error => {
            console.log(error.response)
        });
    }

    render() {
        return (
            <div className="data-in-page">
                {localStorage.getItem('loginfo')}
                <p onClick={() => this.dateClick()}>click</p>
                {this.state.data}
            </div>
        );
    }
}

export default Konto;
